INSERT INTO `cd` (`id`, `nazev`, `popis`, `cena`, `foto`) VALUES
(1,	'Michal Tučný Revival Band - Abych tu žil dál',	'<p>\n  Distribuce Hudební vydavatelství PREMIERMUSIC. První CD revivalové kapely Michala Tučného na Moravě.\n</p>\n<p>\n  CD obsahuje výběr 15-ti nejznámějších skladeb posledního kovboje české country music Michala Tučného. Nahráno v září 2014 ve studiu ASI ve Frýdku Místku.\n</p>\n<p>\n  Poslechněte si <a href=\"http://www.michaltucnyrevival.cz/cd-video/\">ukázky skladeb</a>.\n</p>\n\n<table>\n  <tr><td>1.</td><td> Intro</td><td>M. Smolan / L. Piskoř / L. Zalubil</td><td>1:31</td></tr>\n  <tr><td>2.</td><td> Little Big Horn (Jim Bridger Story)</td><td>L. Payne / J. Vyčítal</td><td>3:03</td></tr>\n  <tr><td>3.</td><td> Projíždím</td><td>Z. Rytíř / M. Horáček</td><td>2:49</td></tr>\n  <tr><td>4.</td><td> Spím v obilí (Gone To Alabama)</td><td>M. Newbury /V. Poštulka</td><td>3:10</td></tr>\n  <tr><td>5.</td><td> Ponny Expres</td><td>J. Zima / Z. Rytíř</td><td>2:36</td></tr>\n  <tr><td>6.</td><td> Abych tu žil</td><td>P. Krejča / Z. Rytíř</td><td>3:37</td></tr>\n  <tr><td>7.</td><td> Boty z kůže toulavých psů</td><td>Z. Rytíř / Z. Rytíř</td><td>2:41</td></tr>\n  <tr><td>8.</td><td> Tak už mi nefňukej (Drivin´My Life Away)</td><td>E. Rabbitt / Z. Rytíř</td><td>2:58</td></tr>\n  <tr><td>9.</td><td> Snídaně v trávě (Sea Of Heartbreak)</td><td>H. David / Z. Rytíř</td><td>2:42</td></tr>\n  <tr><td>10.</td><td> Pověste ho vejš</td><td>Z. Rytíř / Z. Rytíř</td><td>2:53</td></tr>\n  <tr><td>11.</td><td> Rovnou tady rovnou (Roll On Buddy Roll On)</td><td>D. Wilburn / J. Vyčítal</td><td>3:53</td></tr>\n  <tr><td>12.</td><td> Tam u nebeských bran</td><td>J. Zmožek / Z. Rytíř</td><td>3:50</td></tr>\n  <tr><td>13.</td><td> Blues Folsomský věznice</td><td>J. Cash / J. Vyčítal</td><td>2:29</td></tr>\n  <tr><td>14.</td><td> Poslední kovboj</td><td>Z. Rytíř / Z Rytíř</td><td>2:46</td></tr>\n  <tr><td>15.</td><td> Báječná ženská (Good Hearted Woman)</td><td>W. Jeninnings / Z. Rytíř</td><td>4:20</td></tr>\n  <tr><td>&nbsp;</td><td> Total time </td><td>&nbsp; </td><td>45:18</td></tr>\n</table>',	150,	'cd-1.jpg'),
(2,	'Sekáči - Príma den',	'<p>\r\n CD dnes již neexistující country kapely z Frýdku Místku. Obsahuje převzaté i vlastní autorské písně. Převážnou část textů napsali členové skupiny Lubomír Zalubil a Ivan Adámek. Nahráno ve studiu Českého rozhlasu Ostrava v květnu 1999.\r\n</p>\r\n\r\n<table>\r\n<tr><td>1.</td><td> Tak se loučím (Be My Baby Tonight) </td><td>F. Hill, I. Fagan / L. Zalubil </td><td>3:37</td></tr>\r\n<tr><td>2.</td><td> Lesní víla </td><td>L. Zalubil / L. Zalubil </td><td>2:57</td></tr>\r\n<tr><td>3.</td><td> Mám tě zasi v domě </td><td>T. Benda / L. Zalubil </td><td>2:57</td></tr>\r\n<tr><td>4.</td><td> Ztracené pádlo </td><td>L. Zalubil / L. Zalubil </td><td>3:06</td></tr>\r\n<tr><td>5.</td><td> Já musím jít (Dreaming Whit, My Eyes Open) </td><td>T. Arata / I. Adámek </td><td>2:43</td></tr>\r\n<tr><td>6.</td><td> Jen si zpívej (Také It Easy) </td><td>J. Browene / I. Adámek </td><td>3:14</td></tr>\r\n<tr><td>7.</td><td> Jessie L. </td><td>Zalubil / L. Zalubil </td><td>2:47</td></tr>\r\n<tr><td>8.</td><td> Dlouhá řeka (The River Konows Your Name) </td><td>J. Hiatt / J. Tršková </td><td>4:18</td></tr>\r\n<tr><td>9.</td><td> Príma den </td><td>I. Kemada / I. Adámek </td><td>2:07</td></tr>\r\n<tr><td>10.</td><td> Do ráje </td><td>L. Zalubil / L. Zalubil </td><td>3:02</td></tr>\r\n<tr><td>11.</td><td> Blbej den </td><td>A. Antalský / I. Adámek </td><td>3:16</td></tr>\r\n<tr><td>12.</td><td> Snad sním (My Love) </td><td>P. Howell /I. Adámek </td><td>3:58</td></tr>\r\n<tr><td>13.</td><td> Dívka z baru (Aint Necessarily So) </td><td>B. N. Chapman / L. Zalubil </td><td>3:07</td></tr>\r\n<tr><td>14.</td><td> Chci si s tebou hrát </td><td>T. Benda / L. Zalubil </td><td>2:25</td></tr>\r\n<tr><td>15.</td><td> Nech mě být L. Zalubil / L. </td><td>Zalubil </td><td>2:42</td></tr>\r\n<tr><td>16.</td><td> Dámy (She dont Love Nobody) </td><td>P. Haitt / L. Zalubil </td><td>2:43</td></tr>\r\n<tr><td>&nbsp;</td><td> Total time </td><td>&nbsp; </td><td>49:00</td></tr>\r\n</table>',	100,	'cd-2.jpg'),
(3,	'Mr. Bill - Máme štěstí',	'<p>\r\n  Autorské CD frýdecko-místeckého rodáka Lubomíra Zalubila. S výjimkou \r\nskladby Hippies a Ty, které složil i otextoval Karel Lupoměský, jsou na \r\nCD jeho vlastní skladby. Kapela Mr. Bill již neexistuje, působila na \r\nseverní Moravě v letech 2002 – 2008. Hostem ve studiu byla přední česká \r\ncountry zpěvačka Milena Soukupová, která nazpívala duet Pojď se mnou dál \r\na píseň Žlutý náklaďák.\r\n</p>\r\n<p>\r\n Produkce Lubomír Zalubil, natočeno ve studiu ASI Frýdek Místek duben – červen 2001.\r\n</p>\r\n\r\n<table>\r\n<tr><td>1.</td><td> Ty </td><td>4:40</td></tr>\r\n<tr><td>2.</td><td> Pod dekou </td><td>3:02</td></tr>\r\n<tr><td>3.</td><td> Když jsem sám </td><td>2:52</td></tr>\r\n<tr><td>4.</td><td> Blůzka </td><td>4:08</td></tr>\r\n<tr><td>5.</td><td> Slaměná vdova </td><td>3:35</td></tr>\r\n<tr><td>6.</td><td> Horké víno </td><td>3:35</td></tr>\r\n<tr><td>7.</td><td> Žlutý náklaďák </td><td>3:27</td></tr>\r\n<tr><td>8.</td><td> Máme štěstí </td><td>3:10</td></tr>\r\n<tr><td>9.</td><td> Hippies </td><td>2:55</td></tr>\r\n<tr><td>10.</td><td> Mám jedno přání </td><td>3:36</td></tr>\r\n<tr><td>11.</td><td> Tak se mi zdá </td><td>3:39</td></tr>\r\n<tr><td>12.</td><td> Tvůj ranč </td><td>2:19</td></tr>\r\n<tr><td>13.</td><td> Už se stmívá </td><td>2:17</td></tr>\r\n<tr><td>14.</td><td> Pojď se mnou dál </td><td>3:26</td></tr>\r\n</table>',	100,	'cd-3.jpg'),
(4,	'O, pójmy my, pójmy...',	'<p>Pásmo koled a vyprávění soubrů SLEZAN a SLEZANEK z Českého Těšína.</p>\r\n<p>Nahráno ve studiu Českého rozhlasu Ostrava v srpnu a září 2014.</p>',	100,	'cd-4.jpg');
