INSERT INTO `hudba_agentura` (`id`, `nazev`, `popis`, `www`, `foto`) VALUES
(1,	'MICHAL TUČNÝ REVIVAL BAND',	'Jsme revival Michala Tučného na Moravě, se sídlem ve Frýdku-Místku.\n\nNaše produkce je vhodná pro společenské a obecní akce, festivaly, kluby, firemní a soukromé večírky. V neposlední řadě jsou uspěšné i samostatné koncerty.\n\nCelý koncert je spíš vzpomínka na velkou osobnost a nezapomenutelnou legendu české country, Michala Tučného.',	'http://www.michaltucnyrevival.cz/',	'kapela-1.JPG'),
(3,	'Staré časy',	'Máte rádi kytary? Máte rádi staré rockové i country pecky, které  nestárnou? Naše kapela hraje  především tento styl... Samozřejmě i  ze současnosti (No Name, Chinaski apod.), něco i z vlastní tvorby kapelníka Luboše. \r\n\r\nSeveromoravský kraj',	'http://kapelastarecasy.webnode.cz',	'kapela-3.jpg'),
(6,	'Lubomír Piskoř - posezení s harmonikou',	'Vystoupení je bez jakékoliv aparatury a maximální délka trvání je 4 hodiny. tel. 602 744 055 ',	'www.premiermusic.cz',	'kapela-6.JPG'),
(7,	'LuLu Band',	'Kapela hrající především české a slovenské hity různých žánrů pop, rock, folk, country i lidových písní.\n Naše produkce je vhodná na oslavy a párty všeho druhu. Firemní akce, rodinné oslavy a společenské akce.\n Název kapely LuLu Band vychází ze dvou křestních jmen zakládajících členů kapely Lubomír Zalubil a Lubomír Piskoř.\nVšichni členové kapely jsou zkušenými muzikanty a jsou připraveni vás skvěle pobavit na jakékoliv vaší párty či oslavě. ',	'http://luluband.cz',	'kapela-7.jpg');
INSERT INTO `hudba_bazar` (`id`, `text`, `email`, `tel`, `datum`, `typ`, `hudba_bazar_kategorie_id`, `foto1`, `foto2`, `foto3`) VALUES
(75,	'Rocková kapela Full Time hledá zpěváka/zpěvačku na úrovni s rockovým hlasem a obrovským chtíčem být součástí pohodové rockové bandy chlapů v nejlepších letech. A odkud že jsme? Podbořansko (15km od Žatce, 20km od Kadaně, 3/4 hodiny jízdy z Karlových Varů, 35km z Rakovníku a 38km z Mostu.......žádná dálka) A stojí to opravdu za to. Hrajeme vlastní tvorbu, na které se budeš aktivně podílet. Těšíme se na to, až se ozveš a všechno parádně klapne.',	'horac@podborany.cz',	'721141602',	'2020-05-10',	'poptavka',	5,	'inzerat-75-1.jpg',	NULL,	NULL),
(76,	'Rocková kapela Full Time hledá zpěváka/zpěvačku na úrovni s rockovým hlasem a obrovským chtíčem být součástí pohodové rockové bandy chlapů v nejlepších letech. A odkud že jsme? Podbořansko (15km od Žatce, 20km od Kadaně, 3/4 hodiny jízdy z Karlových Varů, 35km z Rakovníku a 38km z Mostu.......žádná dálka) A stojí to opravdu za to. Hrajeme vlastní tvorbu, na které se budeš aktivně podílet. Těšíme se na to, až se ozveš a všechno parádně klapne.',	'horac@podborany.cz',	'721141602',	'2020-05-10',	'poptavka',	5,	'inzerat-76-1.jpg',	NULL,	NULL),
(77,	'Koupím mixpult\nMenší mix do domácího studia, analog nebo digital, něco trochu kvalitnějšího. Behringer a podobné prosím nenabízejte.\nDěkuji za nabídky.\n',	'tcel@seznam.cz',	'',	'2020-05-11',	'poptavka',	5,	'inzerat-77-1.jpg',	NULL,	NULL),
(78,	'Prodám Softube Console 1 Mk 2\nchanel strip, simulace SSL mixu',	'romandobrev@gmail.com',	'603306717',	'2020-05-15',	'prodej',	5,	'inzerat-78-1.jpg',	NULL,	NULL),
(79,	'Helt ny Pioneer DJ DDJ-1000SRT 4-kanals professionell DJ-controller för rekordbox dj\nFrakt- och hanteringsavgifter över hela världen är gratis.\n\nI lager finns också andra modeller som Pioneer, Denon, Rane, allen & Heath, Roland, Amplifier, Bose Home Thearter, Yamaha, Lightings och JBL-högtalare.\n\nFör att beställa kontakt via ...\nKontakt: dj.gadgetbazaarltd@gmail.com\nWhatsapp: +14089163765\n\nDetta paket innehåller:\nVad finns i boxen\nDDJ-1000 SRT\nväxelströmsadapter\nUSB-kabel\nSnabbstartsguide\nrekordbox dj licensnyckelkort\n\nSpecifikationer\nBredd 708 mm.\nHöjd 73,4 mm\nDjup 361,4 mm\nVikt 6 kg\nLjudkort 24 bit / 44,1 kHz\nFrekvensområde 20 20000 Hz\nSignal-till-brusförhållande 112 dB\nDistorsion 0,002 (USB)\nFader Start Ja',	'dj.gadgetbazaarltd@gmail.com',	'4089163765',	'2020-05-19',	'prodej',	5,	'inzerat-79-1.jpg',	'inzerat-79-2.jpg',	NULL),
(81,	'Šířka 1 234 mm (48-9 / 16 \")\nVýška 138 mm (5-7 / 16 \")\nHloubka 456 mm (17-15 / 16 \")\nHmotnost Hmotnost 13,0 kg\n\nOvládací rozhraní\nKlávesnice Počet kláves: 76\nTyp: Organ (FSX), Počáteční dotyk / Aftertouch\nDotyková odezva: Normální, Snadná1, Snadná2, Měkká1, Měkká2, Tvrdá1, Tvrdá2\nOstatní řadiče\nJoystick: Ano\nOvládací knoflíky: 6 ovládacích knoflíků Live (přiřaditelné)\nPosuvníky: 9 posuvníků Live Control (přiřaditelné), Cross Fader\nUmění. Spínače: 3\n\nHlavní displej: TFT barevný širokoúhlý VGA LCD\nVedlejší displej: OLED (zobrazení živého ovládání)\nDotyková obrazovka: Ano\nHlavní displej: angličtina, němčina, francouzština, španělština, italština |\nVedlejší zobrazení: anglicky\n\nZprávy přímo pro další informace.\n\nWhatsapp: +447405834616',	'soundmann@list.ru',	'42003987383',	'2020-08-28',	'prodej',	3,	'inzerat-81-1.jpeg',	'inzerat-81-2.jpeg',	NULL);
